The University System comprises 11 institutional units:

Three main campuses: Ro Piedras, Mayaguez, and Medical Sciences, with Research Universities High Research Activity;
Masters Colleges and Universities - Larger Programs, and; Special Focus Institutions - Medical Schools and Medical Centers Carnegie Classifications, respectively;
Eight colleges: UPR at Cayey, Humacao, Arecibo, Bayamon, Ponce, Aguadilla, Carolina, and Utuado with Baccalaureate Colleges - Diverse Fields Carnegie Classification.
